import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { CartProvider } from './contexts/CartContext';
import { ChecklistProvider } from './contexts/ChecklistContext';
import { ToastProvider } from './components/ToastContainer';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import RitualLookup from './pages/RitualLookup';
import RitualDetail from './pages/RitualDetail';
import TrayCatalog from './pages/TrayCatalog';
import Cart from './pages/Cart';
import Checkout from './pages/Checkout';
import Login from './pages/Login';
import Register from './pages/Register';
import VerifyOTP from './pages/VerifyOTP';
import Profile from './pages/Profile';
import AdminPanel from './pages/AdminPanel';
import ShipperPanel from './pages/ShipperPanel';
import StaffDashboard from './pages/StaffDashboard';
import Checklist from './pages/Checklist';
import TestLogin from './pages/TestLogin';
import ProtectedRoute from './components/ProtectedRoute';
import ForgotPassword from './pages/ForgotPassword';

function App() {
  return (
    <Router>
      <AuthProvider>
        <ToastProvider>
          <ChecklistProvider>
            <CartProvider>
              <div className="min-h-screen flex flex-col">
                <Navbar />
                <main className="flex-grow">
                  <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/rituals" element={<RitualLookup />} />
                    <Route path="/rituals/:id" element={<RitualDetail />} />
                    <Route path="/trays" element={<TrayCatalog />} />
                    <Route path="/cart" element={<Cart />} />
                    <Route path="/checkout" element={<Checkout />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/verify-otp" element={<VerifyOTP />} />
                    <Route path="/test-login" element={<TestLogin />} />
                    <Route path="/profile" element={
                      <ProtectedRoute>
                        <Profile />
                      </ProtectedRoute>
                    } />
                    <Route path="/admin" element={
                      <ProtectedRoute roles={['Admin']}>
                        <AdminPanel />
                      </ProtectedRoute>
                    } />
                    <Route path="/shipper" element={
                      <ProtectedRoute roles={['Shipper']}>
                        <ShipperPanel />
                      </ProtectedRoute>
                    } />
                    <Route path="/staff" element={
                      <ProtectedRoute roles={['Staff', 'Admin']}>
                        <StaffDashboard />
                      </ProtectedRoute>
                    } />
                    <Route path="/checklist" element={
                      <ProtectedRoute>
                        <Checklist />
                      </ProtectedRoute>
                    } />
                    <Route path="/forgot-password" element={<ForgotPassword />} />
                  </Routes>
                </main>
                <Footer />
              </div>
            </CartProvider>
          </ChecklistProvider>
        </ToastProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
